def get_PMmetrics_4( yeartoPull, numberOfMonths, unitsOfMeasurment, metricNames, propertyID):
	metricpulled = pd.DataFrame()
	metricpulled['PropertyID'] = [propertyID]
	try:
		roottemp4 = ES_Client.get_meter_association(propertyID)
		root4 = Et.fromstring(roottemp4)
		for child6 in root4.findall('energyMeterAssociation'):
			for child7 in child6.findall('propertyRepresentation'):
				metricpulled['Metered Areas (Energy)'] = child7.find('propertyRepresentationType').text
		for child8 in root4.findall('waterMeterAssociation'):
			for child9 in child8.findall('propertyRepresentation'):
				metricpulled['Metered Areas (Water)'] = child9.find('propertyRepresentationType').text
	except:
		try:
			sleep(1)
			roottemp4 = ES_Client.get_meter_association(propertyID)
			root4 = Et.fromstring(roottemp4)
			for child6 in root4.findall('energyMeterAssociation'):
				for child7 in child6.findall('propertyRepresentation'):
					metricpulled['Metered Areas (Energy)'] = child7.find('propertyRepresentationType').text
			for child8 in root4.findall('waterMeterAssociation'):
				for child9 in child8.findall('propertyRepresentation'):
					metricpulled['Metered Areas (Water)'] = child9.find('propertyRepresentationType').text
		except:
			pass

	metricpulled.set_index('PropertyID',inplace = True)
	return metricpulled

